import ListaDeContatos from './containers/ListadeContatos/index';
import store from './store';
import EstiloGlobal from './containers/ListadeContatos';

export function App() {
  return (
    <Provider store={store}>
      <EstiloGlobal />
      <containers>
        <ListaDeContatos />
      </containers>
    </Provider>
  );
}
